INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (75, 64, 1, 1, '"[{\"id\":\"sust1\",\"text\":\"Command and control procedures were effectively executed throughout the exercise. Radio discipline was maintained and unit leaders kept their teams informed of changing situations.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:30:00.000Z\",\"tags\":[\"communication\",\"leadership\"]},{\"id\":\"sust2\",\"text\":\"The pre-fire rehearsals conducted at the platoon level significantly improved our coordination during the live-fire portion. This preparation eliminated confusion during critical movement phases.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:30:10.000Z\",\"tags\":[\"preparation\",\"coordination\"]},{\"id\":\"sust3\",\"text\":\"Medical response time was excellent when simulated casualties were reported. The combat lifesavers quickly established collection points and performed proper triage procedures.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:30:20.000Z\",\"tags\":[\"medical\",\"response\"]}]"', '"[{\"id\":\"imp1\",\"text\":\"Communication between platoons during the transition between phases needed improvement. There were several instances where adjacent units were unaware of completed objectives and movement timelines.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:30:30.000Z\",\"tags\":[\"communication\",\"coordination\"]},{\"id\":\"imp2\",\"text\":\"The planning timeline was compressed which limited our ability to conduct thorough rehearsals with attached elements. More time should be allocated for coordination with supporting units.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:30:40.000Z\",\"tags\":[\"planning\",\"time-management\"]},{\"id\":\"imp3\",\"text\":\"Range visibility was severely limited during the early morning portion of the exercise due to fog. Consider scheduling future iterations later in the day to avoid these conditions.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:30:50.000Z\",\"tags\":[\"environment\",\"planning\"]}]"', '"[{\"id\":\"act1\",\"text\":\"Develop a standardized platoon communication SOP that addresses contingency plans for radio failures and establishes clear reporting timelines between elements.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:31:00.000Z\",\"tags\":[\"communication\",\"SOP\"]},{\"id\":\"act2\",\"text\":\"Schedule additional time for pre-exercise rehearsals with all participating and supporting elements to ensure coordination procedures are understood by everyone.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:31:10.000Z\",\"tags\":[\"planning\",\"rehearsal\"]},{\"id\":\"act3\",\"text\":\"Establish a dedicated weather assessment protocol to evaluate training conditions. Include contingency plans for reduced visibility scenarios in future exercise planning.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:31:20.000Z\",\"tags\":[\"planning\",\"environment\"]}]"', '2025-05-18 14:29:57.164094', '2025-05-18 14:29:57.164094', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (76, 64, 1, 1, '"[{\"id\":\"sust4\",\"text\":\"Team cohesion was strong during the exercise. My fire team maintained proper spacing and kept visual contact throughout the movement to contact phase.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:32:00.000Z\",\"tags\":[\"teamwork\",\"tactics\"]},{\"id\":\"sust5\",\"text\":\"Weapons handling and safety procedures were consistently followed by all participants. No safety violations were observed during the entire exercise.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:32:10.000Z\",\"tags\":[\"safety\",\"discipline\"]},{\"id\":\"sust6\",\"text\":\"Our squad demonstrated excellent fire discipline, only engaging targets when positive identification was confirmed and maintaining proper sectors of fire.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:32:20.000Z\",\"tags\":[\"discipline\",\"tactics\"]}]"', '"[{\"id\":\"imp4\",\"text\":\"My team experienced equipment issues with the AN/PRC-148 radios during the exercise. Two radios failed during the most critical portion of the movement, forcing us to rely on hand signals.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:32:30.000Z\",\"tags\":[\"equipment\",\"communication\"]},{\"id\":\"imp5\",\"text\":\"Ammunition distribution was uneven across squads. My team had to redistribute ammunition during the exercise which caused unnecessary delays during our movement.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:32:40.000Z\",\"tags\":[\"logistics\",\"planning\"]},{\"id\":\"imp6\",\"text\":\"Our squad lacked sufficient night vision devices for the early morning portion, limiting our effectiveness in low-light conditions. This created a safety risk during initial maneuvers.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:32:50.000Z\",\"tags\":[\"equipment\",\"safety\"]}]"', '"[{\"id\":\"act4\",\"text\":\"Conduct a maintenance inspection of all AN/PRC-148 radios before the next field exercise. Submit equipment replacement requests for any radios showing signs of failure.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:33:00.000Z\",\"tags\":[\"equipment\",\"maintenance\"]},{\"id\":\"act5\",\"text\":\"Create a detailed checklist for pre-combat inspections that specifically addresses ammunition distribution and equipment checks at the team level.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:33:10.000Z\",\"tags\":[\"logistics\",\"SOP\"]},{\"id\":\"act6\",\"text\":\"Request additional night vision devices for the company inventory and implement a sign-out process to ensure equitable distribution across all squads for future exercises.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:33:20.000Z\",\"tags\":[\"equipment\",\"logistics\"]}]"', '2025-05-18 14:30:17.459154', '2025-05-18 14:30:17.459154', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (77, 64, 1, 1, '"[{\"id\":\"sust7\",\"text\":\"The integration between fire teams during the exercise was excellent. All members understood the importance of supporting fire and maneuver tactics.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:34:00.000Z\",\"tags\":[\"teamwork\",\"tactics\"]},{\"id\":\"sust8\",\"text\":\"Communication between the squad leaders and platoon leadership was clear and concise. Mission orders were understood and executed effectively.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:34:10.000Z\",\"tags\":[\"communication\",\"leadership\"]},{\"id\":\"sust9\",\"text\":\"The tactical movement of all squads demonstrated proper use of cover and concealment. Teams moved quickly between positions while maintaining security.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:34:20.000Z\",\"tags\":[\"tactics\",\"movement\"]}]"', '"[{\"id\":\"imp7\",\"text\":\"Coordination between our squad and adjacent units was problematic. There were several occasions when we were unaware of adjacent unit positions, creating potential danger zones.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:34:30.000Z\",\"tags\":[\"coordination\",\"safety\"]},{\"id\":\"imp8\",\"text\":\"The exercise highlighted deficiencies in our night operations capabilities. The lack of sufficient night vision equipment slowed our progress during dawn hours.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:34:40.000Z\",\"tags\":[\"equipment\",\"training\"]},{\"id\":\"imp9\",\"text\":\"Our squad experienced issues with radio communication in dense vegetation areas. This limited our ability to coordinate effectively with command during critical phases.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:34:50.000Z\",\"tags\":[\"communication\",\"equipment\"]}]"', '"[{\"id\":\"act7\",\"text\":\"Implement a formal adjacent unit coordination procedure including regular position updates and clear visual identification methods for all exercises.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:35:00.000Z\",\"tags\":[\"coordination\",\"SOP\"]},{\"id\":\"act8\",\"text\":\"Submit equipment request for additional night vision devices and implement training specifically focused on night operations.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:35:10.000Z\",\"tags\":[\"equipment\",\"training\"]},{\"id\":\"act9\",\"text\":\"Conduct signal training focusing on alternate communication methods when primary radios fail. Practice relay techniques and non-verbal communication.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":9,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:35:20.000Z\",\"tags\":[\"communication\",\"training\"]}]"', '2025-05-18 14:31:16.237376', '2025-05-18 14:31:16.237376', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (78, 64, 1, 1, '"[{\"id\":\"sust10\",\"text\":\"Second platoon maintained excellent fire discipline throughout the exercise, especially during the complex maneuver phases on the northern ridge.\",\"authorId\":1,\"authorRank\":\"Captain\",\"unitId\":5,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:40:00.000Z\",\"tags\":[\"discipline\",\"tactics\"]},{\"id\":\"sust11\",\"text\":\"The implementation of the new comms check procedure every 15 minutes significantly improved situational awareness among squad leaders and platoon command.\",\"authorId\":1,\"authorRank\":\"Captain\",\"unitId\":5,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:40:10.000Z\",\"tags\":[\"communication\",\"leadership\"]}]"', '"[{\"id\":\"imp10\",\"text\":\"Water resupply planning was inadequate given the unseasonably warm temperatures. Several soldiers showed early signs of heat exhaustion during the final assault phase.\",\"authorId\":1,\"authorRank\":\"Captain\",\"unitId\":5,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:40:20.000Z\",\"tags\":[\"logistics\",\"planning\"]},{\"id\":\"imp11\",\"text\":\"Second platoon lacked sufficient SAW operators during the exercise due to unexpected personnel transfers. This affected our ability to establish proper support by fire positions.\",\"authorId\":1,\"authorRank\":\"Captain\",\"unitId\":5,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:40:30.000Z\",\"tags\":[\"personnel\",\"tactics\"]}]"', '"[{\"id\":\"act10\",\"text\":\"Establish a mandatory water consumption schedule during exercises with temperatures above 80F and increase the number of water buffalos available at platoon level.\",\"authorId\":1,\"authorRank\":\"Captain\",\"unitId\":5,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:40:40.000Z\",\"tags\":[\"logistics\",\"safety\"]},{\"id\":\"act11\",\"text\":\"Submit request for cross-training additional personnel on SAW operations to ensure each squad has at least two qualified operators at all times.\",\"authorId\":1,\"authorRank\":\"Captain\",\"unitId\":5,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T14:40:50.000Z\",\"tags\":[\"training\",\"personnel\"]}]"', '2025-05-18 14:33:19.44385', '2025-05-18 14:33:19.44385', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (79, 64, 1, 1, '"[{\"id\":\"sust12\",\"text\":\"Our squad performed exceptionally well in executing the bounding overwatch movement techniques. The fire teams maintained proper spacing and security throughout the advance.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":7,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:45:00.000Z\",\"tags\":[\"tactics\",\"teamwork\"]},{\"id\":\"sust13\",\"text\":\"Casualty evacuation drills were executed flawlessly. Combat lifesavers quickly assessed simulated injuries and established proper collection points following unit SOP.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":7,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:45:10.000Z\",\"tags\":[\"medical\",\"training\"]}]"', '"[{\"id\":\"imp12\",\"text\":\"Transition between phases of the assault were poorly coordinated. Our squad received conflicting instructions from platoon leadership regarding the timing of our movement to the final objective.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":7,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:45:20.000Z\",\"tags\":[\"coordination\",\"communication\"]},{\"id\":\"imp13\",\"text\":\"Soldiers struggled with heavy combat loads during the extended movement phase. Several team members experienced reduced mobility and increased fatigue impacting their effectiveness.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":7,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:45:30.000Z\",\"tags\":[\"equipment\",\"endurance\"]}]"', '"[{\"id\":\"act12\",\"text\":\"Create a visual signal chart for phase transitions that can be quickly referenced by all squad members when radio communication is unavailable or unclear.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":7,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:45:40.000Z\",\"tags\":[\"communication\",\"planning\"]},{\"id\":\"act13\",\"text\":\"Conduct a thorough review of individual combat loads and implement a training program focused on load management and physical conditioning for extended operations.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":7,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:45:50.000Z\",\"tags\":[\"equipment\",\"training\"]}]"', '2025-05-18 14:33:34.441389', '2025-05-18 14:33:34.441389', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (80, 64, 1, 1, '"[{\"id\":\"sust14\",\"text\":\"The company as a whole demonstrated exceptional integration of supporting weapons systems. Machine gun teams effectively provided suppressive fire while maneuvering elements advanced on objectives.\",\"authorId\":1,\"authorRank\":\"First Sergeant\",\"unitId\":3,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T14:50:00.000Z\",\"tags\":[\"tactics\",\"firepower\"]},{\"id\":\"sust15\",\"text\":\"Integration with forward observers was excellent. Fire mission requests were processed quickly and strike coordination was precise.\",\"authorId\":1,\"authorRank\":\"First Sergeant\",\"unitId\":3,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T14:50:10.000Z\",\"tags\":[\"coordination\",\"firepower\"]}]"', '"[{\"id\":\"imp14\",\"text\":\"Company-wide PACE plan implementation was inconsistent. Several platoons reverted to primary comms even when degraded, rather than switching to alternates as outlined in the OPORD.\",\"authorId\":1,\"authorRank\":\"First Sergeant\",\"unitId\":3,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T14:50:20.000Z\",\"tags\":[\"communication\",\"planning\"]},{\"id\":\"imp15\",\"text\":\"Logistical resupply operations failed to keep pace with ammunition expenditure. Two platoons had to reduce their rates of fire during the final phase due to ammunition constraints.\",\"authorId\":1,\"authorRank\":\"First Sergeant\",\"unitId\":3,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T14:50:30.000Z\",\"tags\":[\"logistics\",\"planning\"]}]"', '"[{\"id\":\"act14\",\"text\":\"Conduct a company-wide communications exercise focused specifically on PACE plan implementation with degraded primary systems.\",\"authorId\":1,\"authorRank\":\"First Sergeant\",\"unitId\":3,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T14:50:40.000Z\",\"tags\":[\"training\",\"communication\"]},{\"id\":\"act15\",\"text\":\"Revise the ammunition distribution plan to account for realistic expenditure rates and incorporate more frequent resupply operations for extended engagements.\",\"authorId\":1,\"authorRank\":\"First Sergeant\",\"unitId\":3,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T14:50:50.000Z\",\"tags\":[\"logistics\",\"planning\"]}]"', '2025-05-18 14:33:49.519604', '2025-05-18 14:33:49.519604', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (81, 64, 1, 1, '"[{\"id\":\"sust16\",\"text\":\"Our team executed battle drills with precision. We quickly adapted to changing scenarios and maintained proper sectors of fire throughout the exercise.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":8,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:55:00.000Z\",\"tags\":[\"tactics\",\"training\"]},{\"id\":\"sust17\",\"text\":\"The new squad radio check procedures significantly improved our ability to maintain communications even when spread out across difficult terrain.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":8,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:55:10.000Z\",\"tags\":[\"communication\",\"procedures\"]}]"', '"[{\"id\":\"imp16\",\"text\":\"Team members had inconsistent understanding of rally point procedures. When the squad became separated during the dense wooded area movement, it took excessive time to regroup.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":8,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:55:20.000Z\",\"tags\":[\"procedures\",\"training\"]},{\"id\":\"imp17\",\"text\":\"Personal night vision equipment was inadequate for the challenging terrain. Several soldiers, including myself, struggled to navigate effectively in low-light conditions.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":8,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:55:30.000Z\",\"tags\":[\"equipment\",\"training\"]}]"', '"[{\"id\":\"act16\",\"text\":\"Conduct additional training on rally point procedures with emphasis on maintaining unit integrity in difficult terrain and limited visibility conditions.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":8,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:55:40.000Z\",\"tags\":[\"training\",\"procedures\"]},{\"id\":\"act17\",\"text\":\"Request upgraded night vision devices and conduct familiarization training to ensure all soldiers can effectively operate in low-light environments.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":8,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T14:55:50.000Z\",\"tags\":[\"equipment\",\"training\"]}]"', '2025-05-18 14:34:33.761918', '2025-05-18 14:34:33.761918', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (82, 64, 1, 1, '"[{\"id\":\"sust18\",\"text\":\"The employment of crew-served weapons was excellent throughout the exercise. Machine gun teams maintained proper fields of fire and effectively suppressed enemy positions during movement phases.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":10,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:00:00.000Z\",\"tags\":[\"weapons\",\"tactics\"]},{\"id\":\"sust19\",\"text\":\"Ammunition distribution at the beginning of the exercise was well-organized. The weapons squad had adequate amounts for the exercise and clear guidance on expenditure rates.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":10,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:00:10.000Z\",\"tags\":[\"logistics\",\"planning\"]}]"', '"[{\"id\":\"imp18\",\"text\":\"Weapon malfunction procedures were not consistently applied across the company. Several gunners attempted field repairs rather than switching to backup weapons per SOP.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":10,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:00:20.000Z\",\"tags\":[\"weapons\",\"procedures\"]},{\"id\":\"imp19\",\"text\":\"Integration between maneuver elements and supporting weapons was occasionally disjointed. There were instances where machine gun teams were not adequately informed of flanking movement by rifle squads.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":10,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:00:30.000Z\",\"tags\":[\"coordination\",\"communication\"]}]"', '"[{\"id\":\"act18\",\"text\":\"Conduct refresher training on weapon malfunction procedures with emphasis on maintaining the tempo of operations through proper use of backup weapons.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":10,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:00:40.000Z\",\"tags\":[\"training\",\"weapons\"]},{\"id\":\"act19\",\"text\":\"Implement improved coordination procedures between maneuver elements and supporting weapons teams, including dedicated radio channels and visual signals.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":10,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:00:50.000Z\",\"tags\":[\"coordination\",\"communication\"]}]"', '2025-05-18 14:34:48.652027', '2025-05-18 14:34:48.652027', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (83, 64, 1, 1, '"[{\"id\":\"sust20\",\"text\":\"Platoon leaders effectively maintained command and control throughout the exercise despite challenging terrain and communication difficulties. Command posts were properly established and situational updates were regular.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:05:00.000Z\",\"tags\":[\"leadership\",\"command\"]},{\"id\":\"sust21\",\"text\":\"Medical evacuation procedures were executed with precision. Combat lifesavers and the medic worked together seamlessly to triage and evacuate simulated casualties.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:05:10.000Z\",\"tags\":[\"medical\",\"procedures\"]}]"', '"[{\"id\":\"imp20\",\"text\":\"The AN/PRC-148 radios had frequent failures during critical phases of the operation. Several units had to rely on runners to deliver important updates, significantly slowing operational tempo.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:05:20.000Z\",\"tags\":[\"equipment\",\"communication\"]},{\"id\":\"imp21\",\"text\":\"Morning fog severely limited visibility during the initial phase of the exercise. We lacked contingency plans for reduced visibility operations, leading to delays in movement to the first objective.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:05:30.000Z\",\"tags\":[\"planning\",\"environment\"]}]"', '"[{\"id\":\"act20\",\"text\":\"Conduct a thorough inspection of all AN/PRC-148 radios and develop a backup communication plan including visual signals, runners, and alternate radio systems.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:05:40.000Z\",\"tags\":[\"equipment\",\"communication\"]},{\"id\":\"act21\",\"text\":\"Develop and brief platoon-level contingency plans for various environmental conditions, including fog, heavy rain, and extreme temperatures.\",\"authorId\":1,\"authorRank\":\"Lieutenant\",\"unitId\":4,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:05:50.000Z\",\"tags\":[\"planning\",\"environment\"]}]"', '2025-05-18 14:35:26.501408', '2025-05-18 14:35:26.501408', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (84, 64, 1, 1, '"[{\"id\":\"sust22\",\"text\":\"The casualty collection point establishment was executed efficiently. Medics quickly set up triage areas and maintained clear evacuation routes throughout the exercise.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:10:00.000Z\",\"tags\":[\"medical\",\"procedures\"]},{\"id\":\"sust23\",\"text\":\"Squad-level combat lifesavers demonstrated proficiency in initial treatment procedures. Their quick response to simulated casualties ensured rapid stabilization before evacuation.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:10:10.000Z\",\"tags\":[\"medical\",\"training\"]}]"', '"[{\"id\":\"imp22\",\"text\":\"Medical supply distribution was uneven across platoons. First platoon had excess supplies while third platoon experienced shortages during the final exercise phase.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:10:20.000Z\",\"tags\":[\"logistics\",\"medical\"]},{\"id\":\"imp23\",\"text\":\"MEDEVAC request procedures were inconsistently followed by squad leaders. Several 9-line reports lacked critical information, causing delays in simulated evacuations.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:10:30.000Z\",\"tags\":[\"medical\",\"communication\"]}]"', '"[{\"id\":\"act22\",\"text\":\"Implement a standardized medical supply distribution checklist to ensure all platoons have appropriate quantities for each exercise type.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:10:40.000Z\",\"tags\":[\"logistics\",\"medical\"]},{\"id\":\"act23\",\"text\":\"Conduct refresher training on 9-line MEDEVAC request procedures for all squad leaders and ensure laminated reference cards are available in all leader books.\",\"authorId\":1,\"authorRank\":\"Sergeant\",\"unitId\":6,\"unitLevel\":\"Squad\",\"createdAt\":\"2025-05-18T15:10:50.000Z\",\"tags\":[\"training\",\"medical\"]}]"', '2025-05-18 14:35:40.558368', '2025-05-18 14:35:40.558368', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (85, 64, 1, 1, '"[{\"id\":\"sust24\",\"text\":\"The company command post established effective communications relay points that maintained connectivity despite challenging terrain features.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":11,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:15:00.000Z\",\"tags\":[\"communication\",\"planning\"]},{\"id\":\"sust25\",\"text\":\"Implementation of the new signal operating instructions (SOI) improved security and reduced confusion during channel switches. Units followed the planned frequency rotation schedule.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":11,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:15:10.000Z\",\"tags\":[\"communication\",\"security\"]}]"', '"[{\"id\":\"imp24\",\"text\":\"Battery management for radio systems was poor. Several units failed to bring sufficient spare batteries, resulting in communication gaps during extended operations.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":11,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:15:20.000Z\",\"tags\":[\"logistics\",\"equipment\"]},{\"id\":\"imp25\",\"text\":\"Radio discipline deteriorated during high-intensity phases. Multiple individuals transmitted simultaneously, causing channel congestion and missed critical updates.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":11,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:15:30.000Z\",\"tags\":[\"communication\",\"training\"]}]"', '"[{\"id\":\"act24\",\"text\":\"Develop a standardized communications equipment checklist that includes battery requirements and establishes a battery rotation/charging plan for extended operations.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":11,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:15:40.000Z\",\"tags\":[\"logistics\",\"communication\"]},{\"id\":\"act25\",\"text\":\"Conduct radio discipline training for all operators with emphasis on proper transmission procedures during high-tempo operations.\",\"authorId\":1,\"authorRank\":\"Specialist\",\"unitId\":11,\"unitLevel\":\"Platoon\",\"createdAt\":\"2025-05-18T15:15:50.000Z\",\"tags\":[\"training\",\"communication\"]}]"', '2025-05-18 14:35:54.209867', '2025-05-18 14:35:54.209867', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (86, 64, 1, 1, '"[{\"id\":\"sust26\",\"text\":\"Initial ammunition distribution before the exercise was efficiently executed. All units received their basic load according to the logistics annex in the OPORD.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":9,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T15:20:00.000Z\",\"tags\":[\"logistics\",\"planning\"]},{\"id\":\"sust27\",\"text\":\"Vehicle support for the exercise was excellent. All transportation assets were operational and positioned according to the movement plan, facilitating rapid deployment of forces.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":9,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T15:20:10.000Z\",\"tags\":[\"logistics\",\"transportation\"]}]"', '"[{\"id\":\"imp26\",\"text\":\"Resupply operations during the exercise were not synchronized with the operational tempo. Several units experienced ammunition shortages during critical phases of the operation.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":9,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T15:20:20.000Z\",\"tags\":[\"logistics\",\"planning\"]},{\"id\":\"imp27\",\"text\":\"Water distribution during the exercise was inadequate for the weather conditions. The combination of heavy equipment loads and unexpected heat led to higher than anticipated consumption rates.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":9,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T15:20:30.000Z\",\"tags\":[\"logistics\",\"planning\"]}]"', '"[{\"id\":\"act26\",\"text\":\"Develop an improved resupply scheduling system that accounts for variable rates of ammunition expenditure and incorporates triggers for early resupply based on actual usage.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":9,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T15:20:40.000Z\",\"tags\":[\"logistics\",\"planning\"]},{\"id\":\"act27\",\"text\":\"Revise the water supply plan to include a 25% buffer above projected needs and establish more frequent water resupply points throughout the exercise area.\",\"authorId\":1,\"authorRank\":\"Staff Sergeant\",\"unitId\":9,\"unitLevel\":\"Company\",\"createdAt\":\"2025-05-18T15:20:50.000Z\",\"tags\":[\"logistics\",\"planning\"]}]"', '2025-05-18 14:36:09.907471', '2025-05-18 14:36:09.907471', false, NULL);
INSERT INTO public.aars (id, event_id, unit_id, created_by, sustain_items, improve_items, action_items, created_at, updated_at, is_deleted, deleted_at) VALUES (87, 64, 1, 1, '"[{\"id\":\"sust28\",\"text\":\"The combined arms synchronization throughout the exercise was impressive. Artillery, maneuver, and support elements coordinated actions effectively to achieve training objectives.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":1,\"unitLevel\":\"Battalion\",\"createdAt\":\"2025-05-18T15:25:00.000Z\",\"tags\":[\"coordination\",\"training\"]},{\"id\":\"sust29\",\"text\":\"Company-level leadership demonstrated initiative and sound decision-making during complex situations. Commander intent was understood and properly executed even when communications were degraded.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":1,\"unitLevel\":\"Battalion\",\"createdAt\":\"2025-05-18T15:25:10.000Z\",\"tags\":[\"leadership\",\"command\"]}]"', '"[{\"id\":\"imp28\",\"text\":\"Communications readiness across units was inconsistent. Equipment failures, particularly with the AN/PRC-148 radios, created significant gaps in situational awareness at critical junctures.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":1,\"unitLevel\":\"Battalion\",\"createdAt\":\"2025-05-18T15:25:20.000Z\",\"tags\":[\"equipment\",\"communication\"]},{\"id\":\"imp29\",\"text\":\"Integration of environmental factors into planning was insufficient. The exercise revealed gaps in contingency planning for reduced visibility conditions and extreme temperatures.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":1,\"unitLevel\":\"Battalion\",\"createdAt\":\"2025-05-18T15:25:30.000Z\",\"tags\":[\"planning\",\"environment\"]}]"', '"[{\"id\":\"act28\",\"text\":\"Conduct a battalion-wide communications equipment assessment and develop a replacement/upgrade plan for all AN/PRC-148 radios showing signs of degradation.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":1,\"unitLevel\":\"Battalion\",\"createdAt\":\"2025-05-18T15:25:40.000Z\",\"tags\":[\"equipment\",\"communication\"]},{\"id\":\"act29\",\"text\":\"Incorporate environmental analysis more thoroughly into the MDMP process and ensure all OPORDs include detailed contingency plans for various environmental conditions.\",\"authorId\":1,\"authorRank\":\"Colonel\",\"unitId\":1,\"unitLevel\":\"Battalion\",\"createdAt\":\"2025-05-18T15:25:50.000Z\",\"tags\":[\"planning\",\"training\"]}]"', '2025-05-18 14:36:24.423784', '2025-05-18 14:36:24.423784', false, NULL);
